	private static void SetLocalizeForSkins()
	{
		if (skinsLocalizeKey.Count == 0)
		{
			return;
		}
		skinsNamesForPers.Clear();
		for (int i = 0; i < skinsLocalizeKey.Count; i++)
		{
			if (!skinsNamesForPers.ContainsKey(i.ToString()))
			{
				skinsNamesForPers.Add(i.ToString(), LocalizationStore.Get(skinsLocalizeKey[i]));
			}
			else
			{
				skinsNamesForPers[i.ToString()] = LocalizationStore.Get(skinsLocalizeKey[i]);
			}
		}
	}

