	public static Texture2D TextureFromString(string textureString, int w = 64, int h = 32)
	{
		byte[] data = Convert.FromBase64String(textureString);
		Texture2D texture2D = new Texture2D(w, h, TextureFormat.RGBA32, false);
		texture2D.LoadImage(data);
		texture2D.filterMode = FilterMode.Point;
		texture2D.Apply();
		return texture2D;
	}

	public static string StringFromTexture(Texture2D _texture)
	{
		byte[] inArray = _texture.EncodeToPNG();
		return Convert.ToBase64String(inArray);
	}

	public IEnumerator LoadSkinsInTexture()
	{
		for (int i = 0; i < baseSkinsForPersInString.Length; i++)
		{
			skinsForPers.Add(i.ToString(), TextureFromString(baseSkinsForPersInString[i]));
		}
		yield return null;
		string _userSkinsForPersInString = PlayerPrefs.GetString("User Skins", string.Empty);
		Dictionary<string, object> userSkinsForPersInStringDictionary2 = null;
		userSkinsForPersInStringDictionary2 = Json.Deserialize(_userSkinsForPersInString) as Dictionary<string, object>;
		if (userSkinsForPersInStringDictionary2 != null)
		{
			Debug.Log("userSkinsForPersInStringDictionary.Count=" + userSkinsForPersInStringDictionary2.Count);
			foreach (KeyValuePair<string, object> _skin in userSkinsForPersInStringDictionary2)
			{
				skinsForPers.Add(_skin.Key, TextureFromString(_skin.Value.ToString()));
			}
		}
		else
		{
			Debug.Log("userSkinsForPersInStringDictionary==null");
		}
		string _userNameSkinsForPersInString = PlayerPrefs.GetString("User Name Skins", string.Empty);
		Dictionary<string, object> userNameSkinsForPersInStringDictionary2 = null;
		userNameSkinsForPersInStringDictionary2 = Json.Deserialize(_userNameSkinsForPersInString) as Dictionary<string, object>;
		if (userNameSkinsForPersInStringDictionary2 != null)
		{
			foreach (KeyValuePair<string, object> vp in userNameSkinsForPersInStringDictionary2)
			{
				skinsNamesForPers.Add(vp.Key, vp.Value.ToString());
			}
		}
		if (PlayerPrefs.GetInt("LoadOldUserSkins", 0) == 0)
		{
			PlayerPrefs.SetInt("LoadOldUserSkins", 1);
			string[] arrStringNameSkin = Load.LoadStringArray("Mult_arrNameSkin");
			string[] arrStringTitleSkin = Load.LoadStringArray("Mult_arrTitleSkin");
			if (arrStringNameSkin != null && arrStringTitleSkin != null)
			{
				for (int j = 0; j < arrStringNameSkin.Length; j++)
				{
					if (arrStringNameSkin[j].Length > 16 && arrStringNameSkin[j].Substring(0, 16).Equals("User_Multi_Skin_"))
					{
						Texture2D _skin2dPers = SkinsManager.TextureForName(arrStringNameSkin[j], 64, 32, true);
						_skin2dPers.filterMode = FilterMode.Point;
						_skin2dPers.Apply();
						AddUserSkin((j >= arrStringTitleSkin.Length) ? string.Empty : arrStringTitleSkin[j], _skin2dPers);
					}
				}
			}
			else
			{
				Debug.Log(string.Concat("arrStringNameSkin=", arrStringNameSkin, " arrStringTitleSkin", arrStringTitleSkin));
			}
			string path = Path.Combine(SkinsManager._PathBase, Defs.CustomTextureName);
			Texture2D _skin2dCape = ((!File.Exists(path)) ? (Resources.Load("cape_CustomTexture") as Texture2D) : SkinsManager.TextureForName(Defs.CustomTextureName, Defs.CustomCapeTextureWidth, Defs.CustomCapeTextureHeight, true));
			if (_skin2dCape != null)
			{
				_skin2dCape.filterMode = FilterMode.Point;
				_skin2dCape.Apply();
				PlayerPrefs.SetString("User Cape Skin", StringFromTexture(_skin2dCape));
			}
		}
		capeUserTexture = TextureFromString(PlayerPrefs.GetString("User Cape Skin"), 32);
		capeUserTexture.filterMode = FilterMode.Point;
		capeUserTexture.Apply();
		yield return null;
		SetCurrentSkin(PlayerPrefs.GetString("Name Current Skin", "0"));
		yield return null;
	}

