	public static string AddUserSkin(string _nameUserSkin, Texture2D _texture, string nameSkinOld = null)
	{
		int num;
		if (nameSkinOld == null)
		{
			num = 1000;
			foreach (KeyValuePair<string, Texture2D> skinsForPer in skinsForPers)
			{
				if (int.Parse(skinsForPer.Key) > num)
				{
					num = int.Parse(skinsForPer.Key);
				}
			}
			num++;
		}
		else
		{
			num = int.Parse(nameSkinOld);
			skinsForPers.Remove(num.ToString());
			skinsNamesForPers.Remove(num.ToString());
		}
		skinsForPers.Add(num.ToString(), _texture);
		skinsNamesForPers.Add(num.ToString(), _nameUserSkin);
		string @string = PlayerPrefs.GetString("User Skins", string.Empty);
		Debug.Log("_userSkinsForPersInString=" + @string);
		Dictionary<string, object> dictionary = null;
		dictionary = Json.Deserialize(@string) as Dictionary<string, object>;
		if (dictionary == null)
		{
			Debug.Log("(userSkinsForPersInStringDictionary==null)");
			dictionary = new Dictionary<string, object>();
		}
		Debug.Log(num);
		if (dictionary.ContainsKey(num.ToString()))
		{
			dictionary.Remove(num.ToString());
		}
		dictionary.Add(num.ToString(), StringFromTexture(_texture));
		PlayerPrefs.SetString("User Skins", Json.Serialize(dictionary));
		string string2 = PlayerPrefs.GetString("User Name Skins", string.Empty);
		Dictionary<string, object> dictionary2 = null;
		dictionary2 = Json.Deserialize(string2) as Dictionary<string, object>;
		if (dictionary2 == null)
		{
			Debug.Log("userNameSkinsForPersInStringDictionary==null");
			dictionary2 = new Dictionary<string, object>();
		}
		if (dictionary2.ContainsKey(num.ToString()))
		{
			dictionary2.Remove(num.ToString());
		}
		dictionary2.Add(num.ToString(), _nameUserSkin);
		PlayerPrefs.SetString("User Name Skins", Json.Serialize(dictionary2));
		return num.ToString();
	}

	public static void DeleteUserSkin(string _name)
	{
		skinsForPers.Remove(_name);
		skinsNamesForPers.Remove(_name);
		if (_name.Equals(currentSkinNameForPers))
		{
			SetCurrentSkin("0");
		}
		string @string = PlayerPrefs.GetString("User Skins", string.Empty);
		Dictionary<string, object> dictionary = null;
		dictionary = Json.Deserialize(@string) as Dictionary<string, object>;
		if (dictionary != null)
		{
			if (dictionary.ContainsKey(_name))
			{
				dictionary.Remove(_name);
				PlayerPrefs.SetString("User Skins", Json.Serialize(dictionary));
			}
			else
			{
				Debug.LogError("SkinsController error: name user skin not found!");
			}
		}
		else
		{
			Debug.LogError("SkinsController error: not parse userSkinsForPersInStringDictionary!");
		}
		string string2 = PlayerPrefs.GetString("User Name Skins", string.Empty);
		Dictionary<string, object> dictionary2 = null;
		dictionary2 = Json.Deserialize(string2) as Dictionary<string, object>;
		if (dictionary2 != null)
		{
			if (dictionary2.ContainsKey(_name))
			{
				dictionary2.Remove(_name);
				PlayerPrefs.SetString("User Name Skins", Json.Serialize(dictionary));
			}
			else
			{
				Debug.LogError("SkinsController error: name user skin not found!");
			}
		}
		else
		{
			Debug.LogError("SkinsController error: not parse userSkinsForPersInStringDictionary!");
		}
	}

